/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `nacimiento_bebes_AFTER_INSERT` AFTER INSERT ON `nacimiento_bebes` FOR EACH ROW BEGIN
