CREATE DEFINER=`root`@`localhost` FUNCTION `fn_contar_nacimientos`() RETURNS text CHARSET utf8mb4
    DETERMINISTIC
BEGIN
    DECLARE resultado TEXT DEFAULT '';
    DECLARE anio_actual INT;
    DECLARE total_nacimientos INT;
    
    SET anio_actual = 2000;
    
    -- Inicia el bucle para contar nacimientos año por año
    WHILE anio_actual <= 2024 DO
        -- Contar el número de nacimientos para el año actual
        SELECT COUNT(*)
        INTO total_nacimientos
        FROM nacimiento_bebes
        WHERE YEAR(fecha_nacimiento) = anio_actual;
        
        -- Agregar el resultado al texto de salida
        SET resultado = CONCAT(resultado, 'Año ', anio_actual, ': ', total_nacimientos, ' nacimientos\n');
        
        -- Incrementar el año actual
        SET anio_actual = anio_actual + 1;
    END WHILE;
    
    RETURN resultado;
END ;;
DELIMITER ;
