CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_poblar_bd`(v_password varchar(20))
BEGIN
	IF v_password = "qwerty" THEN
	call bd_hospital_210538.sp_insertar_personal_medico(70, null);
    call bd_hospital_210538.sp_insertar_personal_medico(60, "Médico");
    call bd_hospital_210538.sp_insertar_personal_medico(80, "Enfermero");
    call bd_hospital_210538.sp_insertar_personal_medico(25, "Administrativo");
